import React from 'react';
import { Row, Container, Col } from 'react-bootstrap';

import '../App.css';

const CharacterStyles = {
    color: 'white',
    borderColor: 'white',
    borderWidth: '2px',
    borderStyle: 'solid',
    characterImage: {
        width: '40px',
        height: 'auto'
    }
}


const Characters = props => {
    // console.log(props.characters[0]);
    let image_holder1 = [];
    let image_holder2 = [];
    let image_holder3 = [];

    return (
        <div style={CharacterStyles} className='mt-5 mx-auto text-center'>
            <Container>

                {props.characters.map((character, idx) => {
                        // {image_holder.push()}
                        if(idx <= 2){
                            image_holder1.push(
                                <Col lg={3} key={idx}>
                                    <img 
                                        src={character.src} 
                                        alt={character.alt} 
                                        className='character_image'
                                        style={CharacterStyles.characterImage}
                                    />
                                </Col>
                            )
                        }else if(idx > 2 && idx <= 5){
                            image_holder2.push(
                                <Col lg={3} key={idx}>
                                    <img 
                                        src={character.src} 
                                        alt={character.alt} 
                                        className='character_image'
                                        style={CharacterStyles.characterImage}
                                    />
                                </Col>
                            )
                        }else if(idx > 5){
                            image_holder3.push(
                                <Col lg={3} key={idx}>
                                    <img 
                                        src={character.src} 
                                        alt={character.alt} 
                                        className='character_image'
                                        style={CharacterStyles.characterImage}
                                    />
                                </Col>
                            )
                        }
                })}

                {image_holder1.length === 3 && image_holder2.length === 3 && image_holder1.length === 3 &&
                    <div className='mx-auto'>
                        <Row>
                            {image_holder1}
                        </Row>
                        <Row>
                            {image_holder2}
                        </Row>
                        <Row>
                            {image_holder3}
                        </Row>
                    </div>
                }


            </Container>

        </div>
    )
}

export default Characters;
